import React from "react";

const DogrunRegionList: React.FC = () => {
  return (
    <div>
      <h2>DogRunを探す</h2>
      <div>
        <h3>北海道・東北</h3>
        <p>北海道・青森・岩手・宮城・秋田・山形・福島</p>
        <h3>関東</h3>
        <p>茨城・栃木・群馬・埼玉・千葉・東京・神奈川</p>
      </div>
    </div>
  );
};

export default DogrunRegionList;
